Here's an example of how you can write an onSubmit function that sends the form data to a GraphQL API using the fetch API and async/await syntax:

```jsx
const onSubmit = async (e) => {
  e.preventDefault();

  const { name, email, message } = formData;

  const query = `
    mutation CreateFormData($name: String!, $email: String!, $message: String!) {
      createFormData(name: $name, email: $email, message: $message) {
        success
      }
    }
  `;

  const variables = {
    name,
    email,
    message,
  };

  try {
    const response = await fetch('https://api.myapp.com/graphql', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
        Accept: 'application/json',
      },
      body: JSON.stringify({ query, variables }),
    });

    const { data, errors } = await response.json();

    if (errors) {
      throw new Error(errors[0].message);
    }

    if (data.createFormData.success) {
      alert('Form submitted successfully');
    } else {
      throw new Error('Failed to submit form');
    }
  } catch (error) {
    alert(error.message);
  }
};
```

